(10, 'Tiêu hoá', '<p>Bác sĩ Chuyên khoa Tiêu hóa\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\nCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\nTư vấn, khám và điều trị các Bệnh Tiêu hóa</p>\n<p>Ăn uống kém, không ngon\nRối loạn tiêu hóa, táo bón, trĩ\nNhiễm vi khuẩn HP (Helicobacter pylori)\nNội soi dạ dày, đại tràng, tiêu hóa\nBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\nCo thắt thực quản, Hội chứng ruột kích thích\nĐau bụng, dạ dày, đại tràng, thượng vị\nViêm đại tràng, dạ dày, tá tràng\nUng thư dạ dày, U nang tuyến tụy\nBệnh lý về gan, mật\n...</p>\n', 'Bác sĩ Chuyên khoa Tiêu hóa\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\nCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\nTư vấn, khám và điều trị các Bệnh Tiêu hóa\n\nĂn uống kém, không ngon\nRối loạn tiêu hóa, táo bón, trĩ\nNhiễm vi khuẩn HP (Helicobacter pylori)\nNội soi dạ dày, đại tràng, tiêu hóa\nBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\nCo thắt thực quản, Hội chứng ruột kích thích\nĐau bụng, dạ dày, đại tràng, thượng vị\nViêm đại tràng, dạ dày, tá tràng\nUng thư dạ dày, U nang tuyến tụy\nBệnh lý về gan, mật\n...', , '2023-11-21 21:53:08', '2023-11-21 21:53:08'),
(11, 'Tim mạch', '<p>Tim mạch\nBác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nKhám tư vấn tim mạch</p>\n<p>Khó thở, Đau ngực, đau tim\nTăng huyết áp, hạ huyết áp\nRối loạn mỡ máu, cao huyết áp, chóng mặt\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\nCảm giác hồi hộp, tim đập nhanh<br>\nTim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến<br>\nĐã đặt stent tim, nong động mạch vành\nGiãn tĩnh mạch chân<br>\n...</p>\n', 'Tim mạch\nBác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nKhám tư vấn tim mạch\n\nKhó thở, Đau ngực, đau tim\nTăng huyết áp, hạ huyết áp\nRối loạn mỡ máu, cao huyết áp, chóng mặt\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\nCảm giác hồi hộp, tim đập nhanh   \nTim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   \nĐã đặt stent tim, nong động mạch vành\nGiãn tĩnh mạch chân   \n...', , '2023-11-21 21:53:30', '2023-11-21 21:53:30');
INSERT INTO `specialties` (`id`, `name`, `descriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(12, 'Cột sống', '<p>Cột sống\nBác sĩ Chuyên khoa Cột sống\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\nCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\nCác bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nBệnh Thần kinh - Cột sống</p>\n<p>Đau cột sống, đau thắt lưng\nChấn thương cột sống\nCột sống bị đau, sưng, cong, vẹo\nĐau mỏi cổ vai gáy, bả vai\nĐau tê mông xuống chân\nPhồng đĩa đệm\nTê bì tay chân\nThóa hóa đốt sống\nThoái hóa L4, L5\nThoát vị đĩa đệm\nVôi hóa cột sống\nXẹp cột sống\n...</p>\n', 'Cột sống\nBác sĩ Chuyên khoa Cột sống\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\nCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\nCác bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nBệnh Thần kinh - Cột sống\n\nĐau cột sống, đau thắt lưng\nChấn thương cột sống\nCột sống bị đau, sưng, cong, vẹo\nĐau mỏi cổ vai gáy, bả vai\nĐau tê mông xuống chân\nPhồng đĩa đệm\nTê bì tay chân\nThóa hóa đốt sống\nThoái hóa L4, L5\nThoát vị đĩa đệm\nVôi hóa cột sống\nXẹp cột sống\n...', , '2023-11-21 21:53:55', '2023-11-21 21:53:55'),
(13, 'Y học Cổ truyền', '<p>Y học Cổ truyền\nBác sĩ Y học Cổ truyền giỏi\nDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\nTư vấn, khám và điều trị các vấn đề:</p>\n<p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>\n', 'Y học Cổ truyền\nBác sĩ Y học Cổ truyền giỏi\nDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\nTư vấn, khám và điều trị các vấn đề:\n\nBệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', , '2023-11-21 21:54:20', '2023-11-21 21:54:20');
INSERT INTO `specialties` (`id`, `name`, `descriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(14, 'Châm cứu', '<p>Châm cứu\nBác sĩ Châm cứu giỏi</p>\n<p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\nTư vấn, khám và điều trị các vấn đề:</p>\n<p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>\n', 'Châm cứu\nBác sĩ Châm cứu giỏi\n\nBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\nTư vấn, khám và điều trị các vấn đề:\n\nBệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', , '2023-11-21 21:54:43', '2023-11-21 21:54:43'),
(15, 'Sản Phụ khoa', '<p>Sản Phụ khoa\nBác sĩ Sản phụ khoa\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\nKhám và điều trị</p>\n<p>Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh<br>\nTắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,<br>\nKhám hiếm muộn, vô sinh<br>\nKhám Phụ Khoa<br>\nKhám thai sản<br>\nKhám tiền hôn nhân, Tiền sinh<br>\nKiểm tra phụ khoa<br>\nLoạn dưỡng vú<br>\nRong kinh kéo dài<br>\nSiêu âm thai định kỳ<br>\nThai lưu\nU xơ tử cung, Viêm lộ tuyến\n...</p>\n', 'Sản Phụ khoa\nBác sĩ Sản phụ khoa\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.\n\n Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\nKhám và điều trị\n\nRối loạn kinh nguyệt, chậm kinh, đau bụng kinh   \nTắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,       \nKhám hiếm muộn, vô sinh   \nKhám Phụ Khoa   \nKhám thai sản   \nKhám tiền hôn nhân, Tiền sinh   \nKiểm tra phụ khoa   \nLoạn dưỡng vú   \nRong kinh kéo dài   \nSiêu âm thai định kỳ   \nThai lưu\nU xơ tử cung, Viêm lộ tuyến\n...\n', , '2023-11-21 21:55:08', '2023-11-21 21:55:08');
INSERT INTO `specialties` (`id`, `name`, `descriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(16, 'Bệnh Viêm gan', '<p>Bệnh Viêm gan\nBác sĩ Chuyên khoa Bệnh Gan\nDanh sách các bác sĩ Bệnh Gan uy tín đầu ngành tại Việt Nam:\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành bệnh về gan\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n﻿Bác sĩ khám, tư vấn và điều trị\nKhám, tư vấn, điều trị các bệnh truyền nhiễm\nKhám, tư vấn, điều trị các bệnh viêm gan virus B\nKhám, tư vấn, điều trị các bệnh viêm gan virus A,C.\nViêm gan B cấp tính\nViêm gan B mạn tính</p>\n', 'Bệnh Viêm gan\nBác sĩ Chuyên khoa Bệnh Gan\nDanh sách các bác sĩ Bệnh Gan uy tín đầu ngành tại Việt Nam:\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành bệnh về gan\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức...\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n﻿Bác sĩ khám, tư vấn và điều trị\nKhám, tư vấn, điều trị các bệnh truyền nhiễm\nKhám, tư vấn, điều trị các bệnh viêm gan virus B\nKhám, tư vấn, điều trị các bệnh viêm gan virus A,C.\nViêm gan B cấp tính\nViêm gan B mạn tính', , '2023-11-21 21:55:37', '2023-11-21 21:55:37');

